import React from 'react';
import { useNavigate } from 'react-router-dom';

function SelectionPage({ setUserType }) {
    const navigate = useNavigate();

    const handleAlumniClick = () => {
        setUserType('alumni');
        navigate('/signup');
    };

    const handleStudentClick = () => {
        setUserType('student');
        navigate('/signup');
    };

    return (
        <div style={{ textAlign: 'center', padding: '2rem' }}>
            <h1>Select your Relation with College or Institute</h1>
            <button onClick={handleAlumniClick} style={{ margin: '1rem', padding: '1rem 2rem' }}>Alumni</button>
            <button onClick={handleStudentClick} style={{ margin: '1rem', padding: '1rem 2rem' }}>Student</button>
        </div>
    );
}

export default SelectionPage;
